<script>
  function toDataURL(url, callback) {
    let xhr = new XMLHttpRequest();
    xhr.onload = function () {
      var reader = new FileReader();
      reader.onloadend = function () {
        callback(reader.result);
      };
      reader.readAsDataURL(xhr.response);
    };
    xhr.onerror = function (error) {
      alert("Das Bild konnte wegen eines Fehlers nicht geladen werde. Probiere ein anderes." +
        "\n\n" +
        "Mgliche Fehler: \n" +
        "Du bist offline. Geh online!\n" +
        "Cross-Origin-Header ist gesetzt: Da kannst du nichts machen, such dir ein anderes Bild.");
    };
    xhr.open('GET', url);
    xhr.responseType = 'blob';
    xhr.send();
  }

  const presets = {
    'sharepic': {
      width: 800,
      height: 600,
      logoSize: 177
    },
    'testimonial': {
      width: 600,
      height: 800
    },
    'fb-event': {
      width: 1200,
      height: 628,
    },
    'insta-story': {
      width: 600,
      height: 800,
    },
    'insta-post': {
      width: 800,
      height: 800
    },
    'fb-page': {
      width: 820,
      height: 462,
    },
    'twitter-header': {
      width: 1500,
      height: 500,
    }
  };

  const logos = [
    {
      text: 'Zrich',
      value: 'ZH',
      logo: require('./../assets/Logo_jglp_ZH.svg'),
    }
  ];


  export default {
    name: "Configurator",
    data() {
      return {
        dragging: false,
        logo: require('./../assets/Logo_jglp_ZH.svg'),
        logoDataUrl: '',
        backgroundImage: 'https://upload.wikimedia.org/wikipedia/commons/thumb/a/a3/Limmat-Quaibr%C3%BCcke.jpg/1280px-Limmat-Quaibr%C3%BCcke.jpg',
        height: 600,
        width: 800,
        xPosition: -40,
        yPosition: -100,
        fontSize: 40,
        backgroundOverlay: 10.0,
        backgroundImageDataUrl: '',
        logoSize: 199,
        bg: {
          x: '',
          y: '',
          width: '',
          height: '',
        }
      }
    },
    computed: {
      outerStyles() {
        return {
          width: this.width + 'px',
          height: this.height + 'px',
          fontSize: this.fontSize + 'px',
          backgroundImage:
            'linear-gradient(to bottom, rgba(255, 255, 255, ' + this.backgroundOverlay / 100 + ')' +
            ',rgba(255, 255, 255, ' + this.backgroundOverlay / 100 + '))' +
            ',url(' + this.backgroundImageDataUrl + ')',
        }
      },
      contentStyles() {
        return {
          top: this.yPosition + 'px',
          left: this.xPosition + 'px',
        }
      },
      logoStyles() {
        return {
          width: this.logoSize + 'px',
          height: this.logoSize * 0.4572 + 'px',
          backgroundImage: 'url(\'' + this.logoDataUrl + '\')',
        }
      }
    },
    mounted() {
      toDataURL(this.backgroundImage, (dataUrl) => {
        this.backgroundImageDataUrl = dataUrl;
      });
      toDataURL(this.logo, (dataUrl) => {
        this.logoDataUrl = dataUrl;
      });
      this.loadPreset('sharepic');

    },
    methods: {
      loadPreset(preset) {
        console.log(presets[preset]);
        Object.assign(this, presets[preset]);
      },
      startDrag() {
        this.dragging = true;
      },
      stopDrag() {
        this.dragging = false;
      },
      shiftElement(event) {
        if (this.dragging) {
          this.xPosition += event.movementX;
          this.yPosition += event.movementY;
        }
      },
      useLocalFile(event) {
        const reader = new FileReader();

        reader.addEventListener("load", () => {
          this.backgroundImageDataUrl = reader.result;
          console.log(this.backgroundImageDataUrl);
        }, false);
        console.log(this);
        if (event.target.files[0]) {
          reader.readAsDataURL(event.target.files[0]);
        }
      },
      generate() {
        const canvas = document.createElement('canvas');
        const ctx = canvas.getContext('2d');
        canvas.width = this.width;
        canvas.height = this.height;
        var pixelRatio = window.devicePixelRatio || 1;

        // lets scale the canvas and change its CSS width/height to make it high res.
        canvas.style.width = canvas.width + 'px';
        canvas.style.height = canvas.height + 'px';
        canvas.width *= pixelRatio;
        canvas.height *= pixelRatio;
        ctx.setTransform(pixelRatio, 0, 0, pixelRatio, 0, 0);

        const tempImg = document.createElement('img');
        const htmlm = document.getElementById('container').innerHTML;
        const style = document.getElementById('style').innerHTML;
        tempImg.addEventListener('load', onTempImageLoad);
        tempImg.src = 'data:image/svg+xml,' +
          encodeURIComponent('<svg xmlns="http://www.w3.org/2000/svg" width="' + this.width + '" height="' + this.height + '"><foreignObject width="100%" height="100%"><div xmlns="http://www.w3.org/1999/xhtml"><style>' + style + '</style>' + htmlm + '</div></foreignObject></svg>')

        const targetImg = document.createElement('img');

        targetImg.style.width = canvas.style.width;
        targetImg.style.height = canvas.style.height;

        document.getElementById('output').innerHTML = '';
        document.getElementById('output').appendChild(targetImg);

        function onTempImageLoad(e) {
          ctx.drawImage(e.target, 0, 0);
          targetImg.src = canvas.toDataURL()
        }
      }
    },
    watch: {
      backgroundImage: function () {
        toDataURL(this.backgroundImage, (dataUrl) => {
          this.backgroundImageDataUrl = dataUrl;
        });
      }
    }
  }
</script>

